import { FC } from "react";
import ToDo from "../models/todo";
const ToDos: FC<{
  items: ToDo[];
}> = (props) => {
  return (
    <ul>
      {props.items.map((item: any) => (
        <li key={item.id}>{item.text}</li>
      ))}
    </ul>
  );
};

export default ToDos;
